    if (filepath.endsWith('.ts')) filetype = 'typescript'
    else if (filepath.endsWith('.json')) filetype = 'json'
    else if (filepath.endsWith('.vue')) filetype = 'vue'
    else if (filepath.endsWith('.css')) filetype = 'css'
    else if (filepath.endsWith('.less')) filetype = 'css'
    else if (filepath.endsWith('.sass')) filetype = 'css'
    else if (filepath.endsWith('.html')) filetype = 'html'

